import { BrowserRouter } from 'react-router-dom'
import { DataProvider } from './GlobaalState'
export default function App() {
  return (
    <DataProvider>
      <BrowserRouter></BrowserRouter>
      <div>App</div>
    </DataProvider>
  );
}
